"use strict";

function f_gold(nums, k) {
    nums.sort((a, b) => a - b);
    let low = 0, high = nums.length - 1;
    let res = -1;
    while (low < high) {
        let val = nums[low] + nums[high];
        if (val < k) {
            res = Math.max(res, val);
            low += 1;
        } else {
            high -= 1;
        }
    }
    return res;
}
